import data from "./aaaaaa.json";
let newData = [];

export function ido() {
  newData = data.map((e) => {
    let demo = e.changes;
    e.changes = [];
    for (let index = 0; index < demo.length; index++) {
      e.changes.push(demo[index].changeName);
    }
    demo = [];
    console.log(e.changes);
  });

  console.log(newData);
}
